import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <header>
        <a href="/">Home</a>
        <a href="/about">About</a>
      </header>

      <main></main>

      <footer></footer>
    </BrowserRouter>
  );
}

export default App;
